import React from "react";
import { Link } from "react-router-dom";

//import css
import './nav.css'

export const Nav = () => {
    return(
        <>
            <div className = 'div_nav'>
                <nav className = 'nav'>
                    <Link to = '/home'>
                        <h1 className = 'title_nav'>Henry Dogs</h1>
                    </Link>
                    <Link to = '/add'>
                        <p className = 'p_nav'>Agregar raza</p>
                    </Link>
                </nav>
            </div>  
        </>
    )
};
